import React, { useState } from 'react'

const App = () => {

    const [height,setHeight]=useState('')
    const [weight,setWeight]=useState('')
    console.log(setHeight());

    return (
        <>
        <div className="container">
            <h1>BMI CALCULATOR</h1>
            <p className="h">Height</p>
            <input type="text" placeholder="Enter your Heigth"  value={height} onChange={(e)=>{setHeight(e.target.value)}}/>
            <p className="w">Weigth</p>
            <input type="text" placeholder="Enter your Weight" value={weight} onChange={(e)=>{setWeight(e.target.avlue)}}/>
            <br />
            <button>Check</button>
            <p className="result"></p>
        </div>
        </>
    )
}

export default App
